import React from 'react'
import { useParams } from 'react-router'

const EventsDetailPage = () => {
    const params= useParams();
  return (
    <>
      <h1>Event Details!</h1>
      <p>{params.eventID}</p>


    </>
  )
}

export default EventsDetailPage
